import React, { useState,useEffect } from "react";
import "../node_modules/react-vis/dist/style.css";
import axios from "axios";

import {

  XYPlot,
  LineSeries,
  VerticalGridLines,
  HorizontalGridLines,
  XAxis,
  YAxis,


} from "react-vis";


const Connection2 = () => {

  const [i_a, seti_a] = useState([]);
  const [v_ab, setv_ab] = useState([]);

  const chart = () => {


    let current = [];
    let voltage = [];
    axios
      .get("http://localhost:3000/register_values_em6400")
      .then(res => {
        console.log(res);
        for (const dataObj of res.data) {
          current.push(parseInt(dataObj.i_a));
          voltage.push(parseInt(dataObj.v_ab));
        }
      })
      .catch(err => {
        console.log(err);
      });
    console.log(current, voltage);
  };

  useEffect(() => { chart(); }, []);

        return (  <XYPlot height={300} width={700}>
            <VerticalGridLines />
            <HorizontalGridLines />
            <XAxis />
            <YAxis />
            <LineSeries data={[chart.current,chart.voltage]} />
          </XYPlot> );}


export default Connection2;
